}

contract KeepcodingToken is IERC20 {
    string public name = "KeepCoding Token";
    string public symbol = "KCT";
    uint8 public decimals = 2;
    address public creator;
    uint256 public totalSupply;

    mapping(address => uint) public balanceOf;
    mapping(address => mapping(address => uint)) public allowance;

    error InsufficientBalance(uint transfer_amount, uint current_balance);
    error InsufficientAllowance(uint transfer_amount, uint current_approval);

    constructor() {
        creator = msg.sender;
        mint(10000, msg.sender);

    }

    function transfer(address to, uint256 value) external returns (bool) {
        if (balanceOf[msg.sender] < value) {
            revert InsufficientBalance(value, balanceOf[msg.sender]);
        }
        balanceOf[msg.sender] -= value;
        balanceOf[to] += value;
        emit Transfer(msg.sender, to, value);
        return true;
    }

    function approve(address spender, uint256 value) external returns (bool) {
        allowance[msg.sender][spender] += value;
        emit Approval(msg.sender, spender, value);
        return true;
    }
    function transferFrom(address from, address to, uint256 value) external returns (bool) {
        if (balanceOf[msg.sender] < value) {
            revert InsufficientBalance(value, balanceOf[msg.sender]);
        }
        if (allowance[from][msg.sender] < value) {
            revert InsufficientAllowance(value, allowance[from][msg.sender]);
        }                
        balanceOf[from] -= value;
        balanceOf[to] += value;
        emit Transfer(from, to, value);
        return true;
    }

    function mint(uint amount, address receiver) public {
        require(msg.sender == creator, "Solo el creador puede hacer mint");
        balanceOf[receiver] += amount;
        totalSupply += amount;
        emit Transfer(address(0), receiver, amount);
    }

    function burn(uint amount) external {
        balanceOf[msg.sender] -= amount;
        totalSupply -= amount;
        emit Transfer(msg.sender, address(0), amount); 
    }
}

